    return ( 
        <div className="discussion-pg-cont">
            <Navbar />
            <div className="page-content">
                <h1> Discussions </h1>
                <div className="discussion-info">

                </div>
            </div>
            <Messages />

        </div>
     );
}

export default DiscussionPage;
